def randomvariate(pdf,bound,n,xmin=0,xmax=30):   
	"""
	Sample randomly from a pdf
	"""
	x=np.linspace(xmin,xmax,1000) 
	y=list(map(pdf, x))  
	pmin=0  
	pmax=max(y)  
	naccept=0  
	ran=[] 
	while naccept<n:
		x=np.random.uniform(xmin,xmax)
		y=np.random.uniform(pmin,pmax) 
		if y<pdf(x) and x >= bound:  
			ran.append(x)
			naccept=naccept+1  
	ran=np.asarray(ran)  
	return ran

