def g(e):
	return e**(12/19)/(1-e**2)*(1+121/304*e**2)**(870/2299)

def Fe0(e): 
	y, abserr = quad(lambda x: g(x)**4*(1-x**2)**(5/2)/x/(1+121/304*x**2), 0, e)
	y = 48/19/g(e)**4*y
	return y

def a_to_p(a, m1, m2):
	"""
	a, m1, m2 are floats
	[a]: AU
	[m1]: solar masses
	[m2]: solar masses
	"""
	mtot = m1+m2 # in solar masses
	p = (a**3/mtot)**(1/2) # in years
	p = p*365*24 # in hours
	return p

def p_to_a(p, m1, m2):
	"""
	p, m1, m2 are all lists in days, sol mass, sol mass 
	"""
	mtot = [x+y for (x, y) in zip(m1, m2)] # in solar masses
	p = [i/365 for i in p] # in years
	a = []
	for i in range(len(p)):
		a.append((p[i]**2*mtot[i])**(1/3))
	return a # in AU

def check_hubbletime(a, e, m1, m2):
	p = a_to_p(a, m1, m2)
	time = 0.009829*p**(8/3)*(m1+m2)**(-2/3)*(m1*m2/(m1+m2))**(-1)*Fe0(e)
	if time <= 13.8:
		return True
	else:
		return False

def maxw_vel(v, sigma):
	return (2/np.pi)**(1/2)*v**2/sigma**3*np.e**(-v**2/2/sigma**2)

