def eccentricity(model, size):
	if model == 'uniform':
		return np.random.uniform(0, 1, size=size)
	# elif model == 'sana12':
	# 	return powerlaw(0.0, 0.9, -0.45, size=size)
	elif model == 'thermal':
		b = np.random.uniform(0.0, 1, size=size)
		ecc = [i**0.5 for i in b]
		return ecc

