def get_final_params(vs, a, e, m1old):
	anew_list = []
	enew_list = []
	tilt_list = []
	for i in range(n):
		anew, enew, tilt, a3new, e3new, i3new = SNkick(m1old[i], m1new[i], m2[i], a[i], e[i], vs[i])
		if anew > 0 and enew < 1:
			if check_hubbletime(anew, enew, m1new[i], m2[i]):
				anew_list.append(anew)
				enew_list.append(enew)
				tilt_list.append(tilt)
	return anew_list, enew_list, tilt_list

def make_cdf(v_dat, label, color, ax):
	# keep track of total number of points
	tot = len(v_dat)
	print('tot', tot)
	# order the v_dat from smallest to largest
	v_dat.sort()
	# apply to linspace for full range into 50 bins
	# intervals = np.linspace(0, 3.15, 50)
	intervals = np.logspace(-2, 0.5, 50)
	# intervals = np.linspace(v_dat[0], v_dat[-1]+.01, 50)
	# for each x in linspace range, count fraction of y. keep track of all x's and y's
	cumulative = []
	count = 0
	j = 0
	for i in intervals:
		while v_dat[j] < i:
			if v_dat[j] != v_dat[-1]:
				count += 1
				j += 1
			else:
				count += 1
				break
		cumulative.append(count/tot)
	ax.step(intervals, cumulative, where='post', label=label, color=color, linewidth=2.5)
	return intervals, cumulative

def find_y_value(xval, intervals, cumulative):
	for i in range(len(intervals)):
		if intervals[i] <= xval:
			yval = cumulative[i]
	return yval

